import React from 'react';
import { Button } from 'antd';

type ButtonProps = {
    label: string;
    onClick?: () => void;
    type?: 'primary' | 'secondary';
}

export const CButton: React.FC<ButtonProps> = ({label, onClick, type }: ButtonProps) => {
    return (<button onClick={onClick} className={`btn btn--${type} bg-primary text-white py-2 px-4 rounded shadow-button hover:bg-secondary`} >{label}</button>)
}
